import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class ToDoInput extends Component {
  render() {
    return (
      <React.Fragment>
        <input type="text" name="todo">
        </input>
        <button type="button">
          Add to list
        </button>
      </React.Fragment>
    );
  }
}
class ToDo extends Component {
  render() {
    return (
      <h2>
        {this.props.item}
      </h2>
    );
  }
}
class ToDoList extends Component {
  render() {
    return (
      <ToDo item="Go to work">
      </ToDo>
    );
  }
}


class App extends Component {
  render() {
    return (
      <div className="App">
        <ToDoInput>
        </ToDoInput>
        <ToDoList>
        </ToDoList>
      </div>
    );
  }
}

export default App;
